import * as React from 'react';

export default class WelcomeContent extends React.Component {
  render() {
    return (
      <div className="container mt-4">
        <div className="jumbotron jumbotron-fluid">
          <div className="container">
            <h1 className="display-4 text-primary">Société Nationale d'Exploitation et de Distribution des Eaux (SONEDE)</h1>
            <p className="lead">Avenue Slimen Ben Slimen, El Manar II - Tunis 2092</p>
          </div>
        </div>

        <div className="row">
          <div className="col-md-8">
            <h2>Raison sociale</h2>
            <p>Société Nationale d’Exploitation et de Distribution des Eaux (SONEDE).</p>

            <h2>Siège social</h2>
            <p>Avenue Slimen Ben Slimen, El Manar II - Tunis 2092.</p>

            <h2>Forme juridique</h2>
            <p>Établissement public créé par la loi 68-22 du 2 juillet 1968 telle que modifiée par la loi 76-21 du 21 janvier 1976 et considéré comme entreprise publique selon le décret 2004-2265 du 27 septembre 2004. La SONEDE est placée sous la tutelle du Ministère de l’Agriculture, des Ressources Hydrauliques et de la Pêche.</p>


            <h2>Contrôleur d’Etat</h2>
            <p>Amen CHERNI : Contrôleur d’État – Comité du Contrôle d’État – Présidence du Gouvernement.</p>
          </div>

          <div className="col-md-4">
            {/* You can add additional content or use Bootstrap cards for better layout */}
          </div>
        </div>
      </div>
    );
  };
}
